import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function Logout() {
  const navigate = useNavigate(); // hook untuk navigasi

  useEffect(() => {
    // Logika untuk logout pengguna, misalnya menghapus sesi atau token
    // Setelah itu, arahkan pengguna ke halaman login
    // Misalnya, Anda bisa menghapus cookie atau sesi di sini.

    navigate('/login'); // Navigasi ke halaman login setelah logout
  }, [navigate]); // Hook ini hanya dijalankan sekali saat komponen dimuat

  return (
    <div>
      {/* Mungkin bisa menampilkan loading atau pesan logout sementara */}
      <p>Logging out...</p>
    </div>
  );
}

export default Logout;
